-- ----------------------------
--  Table structure for `sys_operate_log`
-- ----------------------------
DROP TABLE IF EXISTS `sys_operate_log`;
CREATE TABLE `sys_operate_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `operator` varchar(50) NOT NULL COMMENT '操作者，用login_name来做',
  `operation` varchar(255) NOT NULL COMMENT '操作（详细）',
  `operate_before` text,
  `operate_after` text,
  `status` int(1) DEFAULT NULL COMMENT '状态 0：操作未完成  1：操作完成',
  `operate_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '操作时间',
  `operate_ip` varchar(15) DEFAULT NULL COMMENT '操作IP',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=356 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

